patch:
diff --git a/Modules/_lsprof.c b/Modules/_lsprof.c
index 257de4387c0..b59d911ea81 100644
--- a/Modules/_lsprof.c
+++ b/Modules/_lsprof.c
@@ -289,10 +289,11 @@ static void clearEntries(ProfilerObject *pObj)
 static void
 initContext(ProfilerObject *pObj, ProfilerContext *self, ProfilerEntry *entry)
 {
+    _PyTime_t t0 = call_timer(pObj);
     self->ctxEntry = entry;
     self->subt = 0;
     self->previous = pObj->currentProfilerContext;
-    pObj->currentProfilerContext = self;
+    self->t0 = t0;
     ++entry->recursionLevel;
     if ((pObj->flags & POF_SUBCALLS) && self->previous) {
         /* find or create an entry for me in my caller's entry */
@@ -303,13 +304,20 @@ initContext(ProfilerObject *pObj, ProfilerContext *self, ProfilerEntry *entry)
         if (subentry)
             ++subentry->recursionLevel;
     }
-    self->t0 = call_timer(pObj);
+    pObj->currentProfilerContext = self;
 }

 static void
 Stop(ProfilerObject *pObj, ProfilerContext *self, ProfilerEntry *entry)
 {
-    _PyTime_t tt = call_timer(pObj) - self->t0;
+    _PyTime_t t0 = self->t0;
+    _PyTime_t subt = self->subt;
+    ProfilerContext *previous = self->previous;
+    
+    /* Temporarily remove from chain to prevent use-after-free during timer call */
+    pObj->currentProfilerContext = previous;
+    _PyTime_t current_time = call_timer(pObj);
+    _PyTime_t tt = current_time - t0;
     _PyTime_t it = tt - self->subt;
     if (self->previous)
         self->previous->subt += tt;
